INSERT INTO `cms` (`id`, `name`, `label`, `description`, `exist`, `active`) VALUES
	(1, 'Strona główna', NULL, 'Zajmujemy się wdrażaniem systemów: \r\n•	ISO 9001:2008\r\n•	ISO 22000:2005\r\n•	ISO 14001:2004\r\n•	ISO 22716:2007\r\n•	PN-N 18001:2004\r\n•	HACCP wg Codex Alimentarius\r\n•	BRC \r\n•	IFS\r\n•	Global GAP\r\n\r\na także:\r\n•	prowadzimy outsourcing w zakresie obsługi w/w systemów\r\n•	wykonujemy audity\r\n•	świadczymy usługi Centrum Obsługi Powypadkowej\r\n•	wykonujemy Świadectwa Charakterystyki Energetycznej Budynków', 1, 0),
	(2, 'Rzeźba', 'Strona label', 'System zarządzania jakością jest częścią systemu zarządzania organizacją ukierunkowanego na osiągnięcie wyników odniesionych do celów dotyczących jakości, spełniających potrzeby, oczekiwania i wymagania stron zainteresowanych.\r\nPosiadanie wdrożonego i certyfikowanego systemu zarządzania jakością na zgodność z normą ISO 9001:2008 jest na europejskim rynku standardem, podstawą do tego, aby w tym rynku uczestniczyć.\r\n Jeszcze parę lat temu posiadanie systemu ISO 9001 świadczyło o przewadze nad konkurencją, a także informowało kontrahentów, kooperantów i klientów końcowych o powtarzalnej jakości produkowanych wyrobów czy świadczonych usług. \r\nObecnie system zarządzania wg ISO 9001:2008 to pierwszy krok w procesie ciągłego doskonalenia firmy, prowadzący do zadowolenia klienta, co w konsekwencji pomaga osiągać wysoką pozycję na rynku.\r\nSystem zarządzania jakością musi być systemem udokumentowanym, zatem firma musi posiadać: politykę i księgę jakości oraz procedury i instrukcje systemowe. Wymagane jest również prowadzenie określonych zapisów świadczących o realizacji działań wymaganych przez normę.\r\nNorma ISO 9001: 2009 ma charakter ogólny i można ją stosować niezależnie od wielkości i charakteru organizacji.', 1, 0),
	(3, 'Bisnes casual', NULL, 'System zarządzania4', 0, 0),
	(4, 'PN-N 18001:2004 / OH', NULL, 'Znormalizowany zgodnie z wymaganiami normy PN-N 18001:2004 / OHSAS 18001:2007\r\nsposób zarządzania bezpieczeństwem i higieną pracy pozwala usystematyzować wszystkie działania dotyczące ochrony pracy. Podstawą funkcjonowania sprawnego systemu jest zaangażowanie całej kadry pracowniczej w działania na rzecz redukcji i eliminowania ryzyka dla pracowników w miejscu pracy. \r\nGłówne założenia normy PN-N 18001:2004 / OHSAS 18001:2007 to:\r\n[list]\r\n[*]przyjęcie polityki bezpieczeństwa i higieny pracy, deklarującej jednocześnie zaangażowanie najwyższego kierownictwa \r\n[*]określenie odpowiedzialności i uprawnień dotyczących warunków BHP\r\n[*]zapewnienie odpowiednich szkoleń\r\n[*]przeprowadzanie oceny ryzyka na stanowiskach pracy \r\n[*]motywowanie pracowników do bezpiecznej i higienicznej pracy\r\n[*]opracowanie systemu komunikowania się w zakresie BHP\r\n[*]opracowanie zasad reagowania na wypadki przy pracy oraz wdrażanie działań korygujących lub zapobiegawczych dotyczących BHP \r\n[*]przeprowadzenie auditów wewnętrznych w zakresie BHP\r\n[/list]\r\n\r\nWprowadzenie w firmie systemu zarządzania bezpieczeństwem i higieną pracy, spełniającego wymagania normy PN-N 18001:2004 / OHSAS 18001:2007 zwiększa zaufanie klientów i kontrahentów, ponieważ organizacja funkcjonuje zgodnie w wymaganiami i regulacjami prawnymi obowiązującymi w zakresie warunków pracy', 0, 0),
	(5, 'ISO 22000', NULL, 'System zarządzania bezpieczeństwem żywności wg ISO 22000:2005 jest międzynarodowym standardem dającym możliwość kontroli zagrożeń bezpieczeństwa żywności na każdym etapie łańcucha żywnościowego. Norma uznaje, że na każdym etapie mogą pojawić się problemy i wymaga, aby organizacja w łańcuchu żywnościowym uwzględniała zagrożenia bezpieczeństwa produktu końcowego dla konsumentów.\r\nNiniejszy międzynarodowy standard łączy wymagania systemu HACCP (zgodnego z Codex Alimentarius) w zależności od potrzeb z Dobrą Praktyką Produkcyjną, Higieniczną, Laboratoryjną, Rolniczą, Transportową, Dystrybucyjną, Handlową i Weterynaryjną. \r\nPonadto norma jest kombinacją następujących elementów:\r\n[list]\r\n[*]systemu zarządzania\r\n[*]komunikacji w łańcuchu żywnościowym\r\n[*]kontroli procesu.\r\n[/list]\r\nWymagania normy umożliwiają firmom nie tylko spożywczym, ale także działającym na rzecz branży spożywczej ( opakowania, magazynowanie i dystrybucja, dodatki do żywności, usługi sanitarno-higieniczne) zaplanować, zaprojektować, wdrożyć, utrzymywać i aktualizować system zarządzania bezpieczeństwem żywności. \r\nPonadto pozwalają:\r\n[list]\r\n[*]oszacować i ocenić wymagania konsumentów\r\n[*]wykazać efektywną komunikację z wszystkimi stronami łańcucha żywnościowego\r\n[*]wykazać zgodność z prawem żywnościowym\r\n[*]starać się o uzyskanie uznawanego na całym świecie certyfikatu.\r\n[/list]', 0, 0),
	(6, 'HACCP', NULL, 'System zarządzania bezpieczeństwem zdrowotnym żywności HACCP (Hazard Analysis and Critical Control Point -  Analiza Zagrożeń i Krytyczny Punkt Kontroli) jest skutecznym narzędziem służącym do eliminacji zagrożeń żywnościowych. \r\nPodstawową zasadą systemu HACCP jest identyfikacja i ocena oraz określenie sposobów eliminacji lub ograniczenia zagrożeń, które mogą się pojawić na każdym etapie postępowania z żywnością – począwszy od zakupów surowców, poprzez procesy wytwórcze, magazynowanie a skończywszy na dystrybucji.\r\nZgodnie z prawodawstwem polskim i Unii Europejskiej każdy podmiot działający na rynku spożywczym musi posiadać wdrożony i utrzymany system HACCP. \r\nObowiązek powyższy regulują następujące przepisy prawne:\r\n- Rozporządzenie (WE) nr 852/2004 Parlamentu Europejskiego i Rady z dnia 29 kwietnia 2004 r. w sprawie higieny środków spożywczych,\r\n- Rozporządzenie (WE) nr 853/2004 Parlamentu Europejskiego i Rady z dnia 29 kwietnia 2004 r. ustanawiającym szczególne przepisy dotyczące higieny w odniesieniu do żywności pochodzenia zwierzęcego, \r\n- Ustawa z dnia 25 sierpnia 2006 r. o bezpieczeństwie żywności i żywienia.', 0, 0),
	(7, 'BRC', NULL, 'Pierwsza wersja Standardu BRC została opublikowana w Wielkiej Brytanii w 1998 roku. \r\nBył to dokument, który formułował wymagania stawiane zakładom spożywczym dostarczającym żywność pod marką własną do sieci brytyjskich hipermarketów. \r\nW chwili obecnej standard ten jest doskonale znany nie tylko w całej Europie, ale również na pozostałych kontynentach. Standard BRC jest cały czas udoskonalany pod kątem spełnienia nowych rozwiązań technologicznych oraz wymagań prawnych dotyczących bezpieczeństwa żywności.\r\nOd stycznia 2012 roku obowiązuje 6wersja standardu.\r\n\r\nStandard BRC wymaga:\r\n- zaangażowania najwyższego kierownictwa \r\n- wdrożenia i utrzymania planu HACCP\r\n- wdrożenia i utrzymania systemu zarządzania jakością \r\n- spełnienia wymagań dotyczących zakładu i jego otoczenia \r\n- spełnienia wymagań dotyczących sposobu nadzorowania procesów, produktów i zachowań personelu.\r\n\r\nCertyfikat BRC może być wydany po wykonaniu auditu przeprowadzonego przez akredytowaną niezależną jednostkę certyfikującą. \r\n\r\n\r\n\r\nBRC opracowało inne normy, stanowiące zbiór Globalnych Norm BRC:\r\n[list]\r\n[*]Globalna Norma dotycząca Opakowań i Materiałów Opakowaniowych BRC – zawierająca wymagania dotyczące przetwarzania materiałów opakowaniowych do pakowania  produktów żywnościowych i konsumenckich\r\n[*]Globalna Norma dotycząca Przechowywania i Dystrybucji BRC – zawierająca wymagania dotyczące przechowywania, dystrybucji, sprzedaży hurtowej usług wykonawców pakowanych i niepakownych produktów żywnościowych , materiałów opakowaniowych i towarów konsumenckich\r\n[*]Globalna Norma dotycząca Produktów Konsumenckich BRC – zawierająca wymagania dotyczaća produkcji i montażu produktów konsumenckich \r\n\r\n[/list]', 0, 0),
	(8, 'IFS', NULL, '[b]International Food Standard[/b] \r\n\r\nStandard opracowany przez specjalistów Zrzeszenia Federalnych Związków Handlowych BDH (Niemcy) oraz Federacji Stowarzyszeń Handlu i Dystrybucji FCD (Francja) na potrzeby dostawców sieci handlowych. \r\nObecnie obowiązuje 6 wersja standardu.\r\n\r\nIFS opracowany został jako narzędzie do okresowej, niezależnej i obiektywnej oceny producentów żywności dostarczających wyroby do markowych sieci handlowych. \r\n\r\nGłównym zadaniem standardu jest unifikacja zasad oceny, procedur auditowych oraz zasad kwalifikowania dostawców.\r\n\r\nKluczowymi kryteriami są:\r\n- System zarządzania jakością, \r\n- Dobre Praktyki ( Produkcyjne, Higieniczne, Dystrybucyjne, Rolnicze), \r\n- System HACCP. \r\n\r\nInternational Food Standard definiuje całość wymagań dotyczących procesu kwalifikowania dostawców zaczynając od zdefiniowania wymagań w stosunku do dostawców poprzez zasady prowadzenia oceny i kompetencje audytorów a kończąc na jednoznacznych kryteriach oceny. \r\n\r\nSystem IFS wymaga certyfikacji przez niezależną akredytowaną jednostkę certyfikującą.', 0, 0),
	(9, 'GLOBAL GAP', NULL, 'System Dobrej Praktyki Rolniczej – GLOBAL GAP \r\n\r\nGospodarstwa rolne w Unii Europejskiej, powinny posiadać opracowany i wdrożony do stosowania Kodeks Dobrej Praktyki Rolniczej (GAP) dotyczący rozmnażania roślin, zarządzania glebą i podłożami, nawożenia, ochrony zbiorów, jakości wody, bezpieczeństwa pracy, higieny podczas zbiorów i pakowania, obróbki po zbiorach, ochrony środowiska oraz BHP.\r\n\r\nSformalizowana Dobra Praktyka Rolnicza tworząca system GLOBAL GAP, koncentruje się na kluczowych zagadnieniach procesu wytwarzania produktów rolnych. \r\nZasadniczym celem systemu jest opracowanie zasad i zarządzanie wg nich gospodarstwem, aby redukować bądź ograniczać ryzyko zagrożeń występujących w procesie produkcji rolnej, które  wpływają na bezpieczeństwo zdrowotne produktów pierwotnych. \r\n\r\nPowyższy system powinien zawierać szczegółowy opis produkcji pierwotnej prowadzonej w danym gospodarstwie, jej oddziaływanie na otoczenie, środowisko naturalne oraz przyszłych konsumentów \r\ni być dostosowany do warunków i specyfiki danego gospodarstwa. \r\n\r\n\r\nDefinicje:\r\n\r\n1.Produkcja pierwotna -obejmuje produkcję, chów lub uprawę produktów pierwotnych, włącznie ze zbieraniem plonów, łowiectwem, łowieniem ryb, udojem mleka oraz wszystkimi etapami produkcji zwierzęcej przed ubojem, a także zbiorem roślin rosnących w warunkach naturalnych. \r\n\r\n2.Produkty pierwotne - produkty gleby, w tym rośliny rosnące w warunkach naturalnych, uprawy roślin, chowu zwierząt, łowiectwa, rybołówstwa morskiego i rybactwa śródlądowego.\r\n\r\n3.Dobre Praktyki GMP i GHP w obszarze rolnictwa (produkcji pierwotnej) definiowane są pojęciem DOBREJ PRAKTYKI ROLNICZEJ, (z j. angielskiego Good Agricultural Practice -GAP).', 0, 0),
	(10, 'Smart casual', NULL, 'PN-EN ISO 22716:2009 - Kosmetyki. Dobre Praktyki Produkcji (GMP). Przewodnik Dobrych Praktyk Produkcji.\r\n\r\nZgodnie z Rozporządzeniem Parlamentu Europejskiego i Rady (WE) Nr 1223/2009 z dn.30.11.2009r dotyczącym produktów kosmetycznych każdy producent kosmetyków z dniem 11 lipca 2013 roku \r\nma obowiązek wdrożenia i utrzymywania systemu Dobrych Praktyk Produkcji.\r\n\r\nAby zapewnić funkcjonowanie rynku wewnętrznego i wysoki poziom ochrony zdrowia ludzi, powyższe rozporządzenie ustanawia przepisy, które musi spełniać każdy produkt kosmetyczny udostępniany na rynku.\r\n\r\nAby sprostać wymagania Rozporządzenia Parlamentu Europejskiego i Rady (WE) Nr 1223/2009, została opracowana norma ISO 22716:2007, stanowiąca przewodnik Dobrych Praktyk Produkcji dla wyrobów kosmetycznych. \r\nW normie zawarto zasady dotyczące zarządzania:\r\n•	zasobami ludzkimi\r\n•	infrastrukturą\r\n•	surowcami i materiałami opakowaniowymi\r\n•	produkcją \r\n•	wyrobami gotowymi\r\n•	laboratorium kontroli jakości\r\n•	postępowania  z produktem, który jest poza specyfikacją \r\n•	odpadami\r\n•	podwykonastwem\r\n•	odstępstwami\r\n•	reklamacjami i wycofaniem z rynku \r\n•	kontrolą zmian\r\n•	audio wewnętrzny\r\n•	nadzór and dokumentacją i zapoisami\r\n\r\nZasady Dobrej Praktyki Produkcji Kosmetyku ‘The Cosmetics- Good Manufacturing Practices (GMP) – Guidelines on Good Manufacturing Practices (ISO 22716:2007)’ zostały zatwierdzone przez ISO oraz CEN. Tekst ISO 22716:2007 został zatwierdzony przez CEN jako EN ISO 22716:2007 bez żadnych zmian. Polskim odpowiednikiem jest PN-EN ISO 22716:2009.', 0, 0),
	(11, 'Oustorsing', NULL, 'AUDITY\r\nOferujemy wykonywanie auditów wewnętrznych oraz auditów u dostawców. \r\nZlecenie wykonywania auditów przez auditorów z zewnątrz daje firmie oszczędność czasu i środków, które trzeba przeznaczyć na szkolenia auditorów wewnętrznych we własnej firmie. \r\nDodatkowo daje ono spojrzenie na system zarządzania funkcjonujący w organizacji  z pozycji osób z zewnątrz, dzięki czemu kierownictwo organizacji uzyskuje bezstronne i rzetelne wnioski poprzez zawarte w raporcie informacje na temat mocnych i słabych stron funkcjonującego systemu. \r\nWycenę przeprowadzania auditów wewnętrznych ustalamy indywidualnie z każdym klientem uzależniając ją  od wielkości organizacji i zakresu systemu.\r\n\r\n\r\n\r\nOUTSOURCING\r\nW ramach oferty współpracy proponujemy powierzenie naszym konsultantom pełnienie funkcji Pełnomocnika ds. Systemu Zarządzania. Usługa skierowana jest przede wszystkim do małych i średnich przedsiębiorstw, w których nie ma potrzeby zatrudniania pełnoetatowego pracownika do utrzymywania i doskonalenia systemu.\r\nTakie rozwiązanie daje firmom wymierne korzyści:\r\n- gwarancję sprawnego funkcjonowania i doskonalenia systemu zarządzania\r\n- oszczędność kosztów utrzymania systemu\r\n- prowadzenie szkoleń wewnętrznych dla pracowników\r\n- profesjonalną pomoc i doradztwo w zakresie systemu zarządzania\r\n- profesjonalne przygotowanie audytorów\r\n- reprezentowanie firmy w kontaktach z jednostką certyfikującą lub/i organami kontrolnymi.', 0, 0),
	(12, 'Weekend-owy', NULL, 'Świadectwo charakterystyki energetycznej budynków jest obowiązkowe od dnia  01.01.2009r.\r\ndla każdego budynku oddawanego do użytkowania oraz budynku podlegającemu zbyciu lub najmowi, a także w przypadku, gdy w wyniku przebudowy lub remontu budynku uległa zmianie jego charakterystyka energetyczna, zgodnie z ustawą Prawo budowlane (Dz. U. Nr 156 poz. 1118 z 2006r. z późniejszymi zmianami).\r\n\r\nObowiązek posiadania świadectwa charakterystyki energetycznej (certyfikatu energetycznego) budynku, lokalu mieszkalnego lub części budynku stanowiącej samodzielną całość techniczno-użytkową wynika z prawa europejskiego i polskiego:\r\n\r\n•	Dyrektywa 2002/91/WE w sprawie charakterystyki energetycznej \r\n•	Prawo budowlane (Dz. U. Nr 156, poz. 1118 z 2006r.) wraz z późniejszymi zmianami.\r\n•	Rozporządzenie Ministra Infrastruktury z dnia 12 kwietnia 2002 r. w sprawie warunków technicznych, jakim powinny odpowiadać budynki i ich usytuowanie (Dz. U. Nr 75, poz. 690 z 2002r.) wraz z późniejszymi zmianami.\r\n•	Rozporządzenie Ministra Infrastruktury z dnia 6 listopada 2008 r. w metodologii obliczania charakterystyki energetycznej budynku i lokalu mieszkalnego lub części budynku stanowiącej samodzielną całość techniczno-użytkową oraz sposobu sporządzania i wzorów świadectw ich charakterystyki energetycznej ( Dz. U. Nr 201, poz.1240 z 2008r.)\r\n\r\nŚwiadectwo charakterystyki energetycznej budynków:\r\n- jest dokumentem sporządzonym i poświadczonym przez uprawnionego specjalistę, które określa wielkość energii zużywanej na potrzeby:\r\n•	Ogrzewania, wentylacji, klimatyzacji\r\n•	Chłodzenia\r\n•	Przygotowania ciepłej wody\r\n•	Oświetlenia (w przypadku budynków użyteczności publicznej)\r\n\r\n- podaje dla ocenionego obiektu (budynku, lokalu) wskaźnik EP, dający informację o jakości energetycznej budynku (lokalu), która ma wpływ na zużycie energii.\r\n•	Stanowi jakościową ocenę energetyczną obiektu\r\n•	Podaje ilościową ocenę zużycia energii\r\n\r\n- podaje wskaźnik EK, wyrażający zapotrzebowanie na energię, jaka powinna być dostarczona do obiektu.\r\n\r\nMoże zawierać wskazania odnośnie możliwych do wykonania robót budowlanych lub innych zmian modernizacyjnych mogących poprawić jakość energetyczną ocenionego obiektu.\r\n\r\nDefinicje:\r\n-wskaźnik EP wyraża wielkość rocznego zapotrzebowania na nieodnawialną energię pierwotną niezbędną do celów ogrzewania i wentylacji oraz podgrzania ciepłej wody użytkowej wraz z energią pomocniczą odniesioną do 1m2 powierzchni użytkowej podaną w kWh/(m2/rok).\r\nPorównanie wskaźnika EP obliczonego dla ocenianego obiektu z wymaganą wartością (podaną w przepisach techniczno- budowlanych) daje jakościową ocenę energetyczną tego obiektu.\r\n\r\n-wskaźnik EK wyraża zapotrzebowanie na energię końcową potrzebną do celów ogrzewania (chłodzenia gdy ma to zastosowanie), wentylacji oraz podgrzania ciepłej wody użytkowej odniesioną do 1m2 powierzchni użytkowej podaną w kWh/(m2/rok).Informuje o rocznym zapotrzebowaniu na energię, która powinna być dostarczona do budynku w celu utrzymania obliczeniowej temperatury wewnętrznej, niezbędnej wentylacji i dostarczenia ciepłej wody użytkowej.\r\n\r\n\r\nAlicja Sperczyńska - Uprawnienia Nr 5440 - Wpis do rejestru osób uprawnionych do sporządzania świadectwa charakterystyki energetycznej budynku, lokalu mieszkalnego oraz części budynku stanowiącej samodzielną całość techniczno-użytkową (Dz.U. Nr 17, poz.104,  2008r).', 1, 0),
	(13, 'Sportowy', NULL, 'Centrum Obsługi Powypadkowej \r\n\r\n\r\nW świetle przepisów prawnych osoby poszkodowane w wypadku mogą i powinny starać się o odszkodowanie.\r\n\r\nNa podstawie umowy agencyjnej pośredniczymy w pomocy w uzyskaniu należnego odszkodowania w wyniku wypadków:\r\n•	drogowych\r\n•	w pracy\r\n•	w podróży\r\n•	w  rolnictwie \r\n\r\noraz w uzyskaniu odszkodowania za:\r\n•	obrażenia osobiste\r\n•	rozstrój zdrowia\r\n•	utracone zarobki\r\n•	niezdolność do pracy na skutek wypadku\r\n•	zwrot wydatków związanych z leczeniem', 1, 0),
